import React from 'react';
import { Navigate } from 'react-router-dom';

function ProtectedRoute({ element, isAuthenticated, onLogout }) {
  // Clone the element and pass onLogout as a prop
  const elementWithLogout = React.cloneElement(element, { onLogout });
  
  return isAuthenticated ? elementWithLogout : <Navigate to="/" />;
}

export default ProtectedRoute;
